import React from "react";
import "../css/edit.css";

function Edit({ showPopup, closePopup }) {
  return showPopup ? (
    <div>
      <h1>Pop-up !!</h1>
      <button onClick={closePopup}>Fermer</button>
    </div>
  ) : null;
}

export default Edit;
